import { motion } from "framer-motion";

function SectionFour({
  advanceState,
  secondSongList,
  setSecondSelectedSong,
  sixAlbums,
}) {
  return (
    <div>
      <div className="mx-auto text-5xl md:-mt-12 md:text-4xl w-1/4 flex flex-col gap-y-2 place-items-stretch">
        <div>
          <motion.div
            initial={{ y: "-20%", opacity: 0 }}
            animate={{ y: "0%", opacity: 1 }}
            transition={{
              ease: "easeOut",
              duration: 1,
              delay: 1,
            }}
            className="italic font-serif"
          >
            try another,
          </motion.div>
        </div>
        <motion.div
          initial={{ y: "-20%", opacity: 0 }}
          animate={{ y: "0%", opacity: 1 }}
          transition={{ ease: "easeOut", duration: 1, delay: 2 }}
          className="flex flex-row justify-between text-8x pt-8"
        >
          {secondSongList.map((item, index) => {
            return (
              <div
                className="w-36 h-36 bg-gray-300"
                onClick={() => {
                  setSecondSelectedSong(item);
                  advanceState();
                }}
                style={{
                  backgroundImage: `url(${
                    sixAlbums(`./${item.Cover}.png`).default
                  })`,
                  backgroundSize: "100%",
                }}
              ></div>
            );
          })}
        </motion.div>
      </div>
    </div>
  );
}

export default SectionFour;
